const list = {
  'ectenias': 'Ectenias',
}

export const Liturgy = () => {
  return (
    <>
      <ul className="library">
        {/* <li className="library__element">
          <Link to="ectenias" className="itemLink">
            Ectenias
          </Link>
        </li> */}
        {list.map(key => (
            <li className="library__element">
            <Link to={k} className="itemLink">
              Ectenias
            </Link>
          </li>
        ))}
      </ul>
    </>
  )
}
